^.*.css:
mark {
  --rdhi-opacity: 15%;
}

/* Raindrop highlights */
mark[data-rdhid] {
  color: inherit !important;
  background-color: var(--rdhc, rgb(255 250 68 / var(--rdhi-opacity))) !important;
}

.rdhnav:before {
  background: var(--rdhc, rgb(255 250 68 / 100%)) !important;
}

mark[data-rdhid][style*="--rdhc: blue"] {
  background: rgb(70 119 255 / var(--rdhi-opacity)) !important;
}

.rdhnav[style*="--rdhc: blue"]:before {
  background: rgb(70 119 255 / 100%) !important;
}

mark[data-rdhid][style="--rdhc: green"] {
  background: rgb(91 158 62 / var(--rdhi-opacity)) !important;
}

.rdhnav[style*="--rdhc: green"]:before {
  background: rgb(91 158 62 / 100%) !important;
}


mark[data-rdhid][style*="--rdhc: red"] {
  background: rgb(219 64 129 / var(--rdhi-opacity)) !important;
}

.rdhnav[style*="--rdhc: red"]:before {
  background: rgb(219 64 129 / 100%) !important;
}

^https://fellowship.hackbrightacademy.co.css:
body, #container, #content {
  width: 100%;
  font-family: 'IBM Plex Mono';
}

#container, #content {
  box-sizing: border-box;
}

#container {
  min-width: unset;
}

.submit-row {
  display: flex;
  padding: 0;
  background: 0;
  border: 0;
}

.deletelink-box {
  position: absolute;
  left: 50%;
}

button, .button, a.deletelink, label, input[type=submit], input {
  font-family: 'IBM Plex Mono';
}

.button, input[type=submit], a.deletelink {
  padding: 4px 8px;
  line-height: 1.2em;
  height: auto;
}

.submit-row input {
  background: black;
  border: 0;
}

.submit-row input:not(:first-child) {
  background: white;
  color: blue;
  font-size: 0.8em;
  text-decoration: underline;
}

.field-notes, .field-upload, .field-location,
.field-id, .column-id, .column-elf, .field-elf,
.column-dri, .field-dri {
  display: none;
}

#changelist-filter {
  position: unset;
}

#toolbar, #changelist .actions, #changelist .results {
  margin-right: 0;
  width: 100%;
}

#fes-changelist-header {
  cursor: pointer;
}

#fes-changelist-body {
  position: absolute;
  background: white;
  max-height: 80vh;
  overflow-y: scroll;
  width: 100%;
}

#fes-config {
  position: fixed;
  top: 0;
  width: fit-content;
  box-sizing: border-box;
  padding: 10px;
  background-color: black;
}

.fes-row {
  display: flex;
  gap: 10px;
  margin-bottom: 20px;
}

#fes-config label {
  font-size: 10px;
  font-weight: 600;
  display: block;
  color: white;
}

#fes-close-config, #fes-open-config, .fes-link-button {
  font-size: 0.88em;
  padding: 0;
  border: 0;
  background: none;
  color: cyan;
  text-decoration: underline;
  cursor: pointer;
}
#fes-close-config:hover, #fes-open-config:hover {
  text-decoration: none;
}
.fes-link-button {
  color: blue;
  font-size: 1em;
  margin: 0 5px;
}

span.datetimeshortcuts {
  display: none;
}

input.vTimeField, input.vDateField {
  display: inline-block;
  border: 0;
  padding: 0;
  font-family: 'IBM Plex Mono';
  background-color: transparent;
  color: red;
}

#fes-filter-cohort {
  display: inline-block;
  padding: 0.25em 0.5em;
  margin: 0.5em 0;
  background-color: blue;
  color: white;
  border-radius: 3px;
}

